DROP TABLE "TRADE_GNNT"."E_SUBORDER";
CREATE TABLE "TRADE_GNNT"."E_SUBORDER" (
"SUBORDERID" NUMBER(15) NOT NULL ,
"ORDERID" NUMBER(15) NULL ,
"SUBFIRMID" VARCHAR2(32 BYTE) NOT NULL ,
"QUANTITY" NUMBER(15,2) DEFAULT 0  NOT NULL ,
"PRICE" NUMBER(15,2) NULL ,
"WAREHOUSEID" VARCHAR2(30 BYTE) DEFAULT 0  NULL ,
"TRADEPRETIME" NUMBER(10) NULL ,
"DELIVERYDAYTYPE" NUMBER(1) NULL ,
"DELIVERYDAY" DATE NULL ,
"DELIVERYPRETIME" NUMBER(10) NULL ,
"DELIVERYMARGIN_B" NUMBER(15,2) NULL ,
"DELIVERYMARGIN_S" NUMBER(15,2) NULL ,
"FROZENMARGIN" NUMBER(15,2) NULL ,
"REMARK" VARCHAR2(256 BYTE) NULL ,
"STATUS" NUMBER(1) NOT NULL ,
"WITHDRAWER" VARCHAR2(16 BYTE) NULL ,
"WITHDRAWTIME" DATE NULL ,
"CREATETIME" DATE NULL ,
"REPLY" VARCHAR2(256 BYTE) NULL ,
"REPLYTIME" DATE NULL 
)
LOGGING
NOCOMPRESS
NOCACHE

;
COMMENT ON COLUMN "TRADE_GNNT"."E_SUBORDER"."TRADEPRETIME" IS '以秒为单位';
COMMENT ON COLUMN "TRADE_GNNT"."E_SUBORDER"."DELIVERYDAYTYPE" IS '0：指定准备天数 1：指定最后交割日';
COMMENT ON COLUMN "TRADE_GNNT"."E_SUBORDER"."STATUS" IS '0：等待挂牌方答复 1：挂牌方接受 2：挂牌方拒绝 3：摘牌方撤单 4：系统自动撤单 5管理员撤单';

