DROP TABLE "TRADE_GNNT"."E_TRADE";
CREATE TABLE "TRADE_GNNT"."E_TRADE" (
"TRADENO" NUMBER(15) NOT NULL ,
"ORDERTITLE" VARCHAR2(128 BYTE) NOT NULL ,
"BREEDID" NUMBER(10) NOT NULL ,
"BFIRMID" VARCHAR2(32 BYTE) NOT NULL ,
"SFIRMID" VARCHAR2(32 BYTE) NOT NULL ,
"PRICE" NUMBER(15,2) NOT NULL ,
"QUANTITY" NUMBER(15,2) DEFAULT 0  NOT NULL ,
"UNIT" VARCHAR2(16 BYTE) NOT NULL ,
"TRADEPRETIME" NUMBER(10) NOT NULL ,
"TRADEMARGIN_B" NUMBER(15,2) NOT NULL ,
"TRADEMARGIN_S" NUMBER(15,2) NOT NULL ,
"DELIVERYDAY" DATE NOT NULL ,
"DELIVERYMARGIN_B" NUMBER(15,2) NOT NULL ,
"DELIVERYMARGIN_S" NUMBER(15,2) NOT NULL ,
"BUYTRADEFEE" NUMBER(15,2) NULL ,
"BUYDELIVERYFEE" NUMBER(15,2) NULL ,
"BUYPAYTRADEFEE" NUMBER(15,2) NULL ,
"BUYPAYDELIVERYFEE" NUMBER(15,2) NULL ,
"SELLTRADEFEE" NUMBER(15,2) NULL ,
"SELLDELIVERYFEE" NUMBER(15,2) NULL ,
"SELLPAYTRADEFEE" NUMBER(15,2) NULL ,
"SELLPAYDELIVERYFEE" NUMBER(15,2) NULL ,
"DELIVERYTYPE" NUMBER(1) NULL ,
"WAREHOUSEID" VARCHAR2(30 BYTE) DEFAULT 0  NULL ,
"DELIVERYADDRESS" VARCHAR2(64 BYTE) NULL ,
"TRADETYPE" NUMBER(1) DEFAULT 0  NOT NULL ,
"PAYTYPE" NUMBER(1) NULL ,
"TIME" DATE NULL ,
"REMARK" VARCHAR2(1024 BYTE) NULL ,
"STATUS" NUMBER(2) NOT NULL ,
"ORDERID" NUMBER(15) NOT NULL 
)
LOGGING
NOCOMPRESS
NOCACHE

;
COMMENT ON COLUMN "TRADE_GNNT"."E_TRADE"."ORDERTITLE" IS '委托时的标题，默认为商品分类名+品名。';
COMMENT ON COLUMN "TRADE_GNNT"."E_TRADE"."TRADEPRETIME" IS '以秒为单位';
COMMENT ON COLUMN "TRADE_GNNT"."E_TRADE"."DELIVERYTYPE" IS '1：指定仓库交收 2：指定交收地交收';
COMMENT ON COLUMN "TRADE_GNNT"."E_TRADE"."TRADETYPE" IS '0： 协议交收 1：自主交收 ';
COMMENT ON COLUMN "TRADE_GNNT"."E_TRADE"."PAYTYPE" IS '0： 先款后货 1： 先货后款 2：不限制';
COMMENT ON COLUMN "TRADE_GNNT"."E_TRADE"."STATUS" IS '0：订单状态 1：订单阶段违约 2：订单阶段系统撤销 3：成交阶段 4：成交阶段违约
5：货、款到位 6：支付首款  7:支付第二笔货款 8:支付尾款（结束）
21：待违约处理(买方违约) 22：待违约处理（卖方违约）
';

